const todoData = [
  {
    id: 1,
    task: "Get out of bed",
  },
  {
    id: 2,
    task: "Brush teeth",
  },
  {
    id: 3,
    task: "Eat breakfast",
  },
  {
    id: 4,
    task: "Eat lunch",
  },

  {
    id: 5,
    task: "Eat Cakeeee",
  },

  {
    id: 6,
    task: "Go for a walk",
  },
  {
    id: 7,
    task: "watch some videos",
  },
];

export default todoData;
